var dimas = require('./dimas-parallel.js');


function someWork(v) {

    return v;
}


console.log('Starting');

dimas.setMaxNumberOfProcesses(3);

dimas.execute(someWork, 'dima')
    .then(function(result) {
        
        console.log('Result:' + result + ';');
    })
    .catch(function(error) { console.log('Error' + error); });




